webpackJsonp([0x9076d3ec60bec800],{"./node_modules/json-loader/index.js!./.cache/json/jquery-jquery-mousedown-method.json":function(e,o){e.exports={data:{markdownRemark:{html:'<h1>Mousedown Method</h1>\n<p>The mousedown event occurs when the left mouse button is pressed.\nTo trigger the mousedown event for the selected element, use this syntax:\n<code>$(selector).mousedown();</code></p>\n<p>Most of the time, however, the mousedown method is used with a function attached to the mousedown event.\nHere’s the syntax:\n<code>$(selector).mousedown(function);</code>\nFor example:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>$(#example).mousedown(function(){\n   alert("Example was clicked");\n});</code></pre>\n      </div>\n<p>That code will make the page alert “Example was clicked” when #example is clicked.</p>\n<h3>More Information</h3>\n<p>More information can be found <a href="https://www.w3schools.com/jquery/event_mousedown.asp">here</a>.</p>',fields:{slug:"/jquery/jquery-mousedown-method/"},frontmatter:{title:"Mousedown Method"}}},pathContext:{slug:"/jquery/jquery-mousedown-method/"}}}});
